INSERT INTO Animes(AnimeID, AnimeTitle, AnimeDesc, TypeID, AiredBegin, AiredEnd, Premiered, Duration, PosterUrl) VALUES (920, CONCAT('Juubee-chan: Lovely Gantai no Himitsu'), CONCAT('Jiyu Nanohana is an ordinary schoolgirl until she runs across a scatterbrained 300 year old samurai who tells her that she is the reincarnation of Yagyu Jubei. With the help of the "Lovely Eyepatch" she transforms into the legendary swordsman whenever she needs to use his awesome fighting ability, which she needs to do quite often as a rival clan is dead set on conquering Yagyu to satisfy an old family grudge.<br><br>(Source: ANN)<br>'), 1, '1999-04-06', '1999-06-29', 'Spring 1999', '25 min. per ep.', 'https://cdn.myanimelist.net/images/anime/13/60987.jpg');
